/**
 * @param {number[][]} grid
 * @return {number[]}
 */
var goodSubsetofBinaryMatrix = function(grid) {
    let m = grid.length, n = grid[0].length;
    let answer = [];

    for (let mask = 1; mask < (1 << m); mask++) {
        let sum = new Array(n).fill(0);
        let bits = 0;
        for (let i = 0; i < m; i++) {
            if ((mask & (1 << i)) > 0) {
                bits++;
                for (let j = 0; j < n; j++) {
                    sum[j] += grid[i][j];
                }
            }
        }

        let isValid = true;
        for (let j = 0; j < n; j++) {
            if (sum[j] > Math.floor(bits / 2)) {
                isValid = false;
                break;
            }
        }

        if (isValid && __builtin_popcount(mask) > answer.length) {
            let newAnswer = [];
            for (let i = 0; i < m; i++) {
                if ((mask & (1 << i)) > 0) {
                    newAnswer.push(i);
                }
            }
            answer = newAnswer;
        }
    }

    return answer;
};
